tables.table_schema:
CREATE TABLE chatbot_training_data (
    id INT PRIMARY KEY,
    user_input TEXT,
    intent TEXT,
    entities TEXT
);

CREATE TABLE chatbot_training_data (
    id INT PRIMARY KEY,
    input_text TEXT,
    output_text TEXT
);

CREATE TABLE chatbot_metadata (
    chatbot_id UUID PRIMARY KEY,
    language TEXT
);

CREATE TABLE chatbot_training_data (
    training_id SERIAL PRIMARY KEY,
    input_text TEXT,
    output_text TEXT
);

CREATE TABLE chatbot_entities (
    entity_id SERIAL PRIMARY KEY,
    entity_name TEXT,
    entity_type TEXT
);

CREATE TABLE chatbot_intents (
    intent_id SERIAL PRIMARY KEY,
    intent_name TEXT,
    intent_description TEXT
);

CREATE TABLE TrainingExamples (
    example_id INT PRIMARY KEY,
    question VARCHAR(255),
    answer VARCHAR(255),
    intent VARCHAR(50)
);

CREATE TABLE IntentLabels (
    intent_id INT PRIMARY KEY,
    intent_name VARCHAR(50)
);

CREATE TABLE UserFeedback (
    feedback_id INT PRIMARY KEY,
    example_id INT,
    feedback_text VARCHAR(255),
    feedback_score INT
);

CREATE TABLE TrainDataMetrics (
    metrics_id INT PRIMARY KEY,
    example_id INT,
    training_time TIMESTAMP,
    accuracy FLOAT
);

CREATE TABLE chatbot_training_data (
    training_id INT PRIMARY KEY,
    text_input TEXT,
    intent_label VARCHAR(50),
    creation_date TIMESTAMP
);

CREATE TABLE entity_data (
    entity_id INT PRIMARY KEY,
    entity_name VARCHAR(50),
    entity_type VARCHAR(50),
    entity_value TEXT
);

CREATE TABLE training_logs (
    log_id INT PRIMARY KEY,
    training_id INT,
    log_text TEXT,
    log_date TIMESTAMP
);
